          state.navigation.footer.find(
            (e) => e.language === this.$i18n.locale
          ) || state.navigation.footer[0]
        ).data.footer_items
      },
      copyrightText(state) {
        return (
          state.navigation.footer.find(
            (e) => e.language === this.$i18n.locale
          ) || state.navigation.footer[0]
        ).data.copyright
      },
      footerItemsLinks(state) {
        return (
          state.navigation.footer.find(
            (e) => e.language === this.$i18n.locale
          ) || state.navigation.footer[0]
        ).data.footer_links
